import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Home from './pages/Home';
import New from './pages/New';
import Edit from './pages/Edit';
import Diary from './pages/Diary';

//components
import MyButton from './components/MyButton';
import MyHeader from './components/MyHeader';

function App() {
  return (
    <BrowserRouter>
    <div className="App"> 
    <MyHeader headText={"headText"} leftChild={
      <MyButton>왼쪽 버튼</MyButton>
    } rightChild={
      <MyButton>오른쪽 버튼</MyButton>
    }></MyHeader>

        <MyButton text={'버튼'} onClick={ () => {
          alert("버튼이 눌렸습니다")
        }} type={"positive"}></MyButton>
        <MyButton text={'버튼'} onClick={ () => {
          alert("버튼이 눌렸습니다")
        }} type={"negative"}></MyButton>
        <MyButton text={'버튼'} onClick={ () => {
          alert("버튼이 눌렸습니다")
        }} type={"default"}></MyButton>

        <Routes>
          <Route path="/" element={<Home></Home>}></Route>
          <Route path="/new" element={<New></New>}></Route>
          <Route path="/edit" element={<Edit></Edit>}></Route>
          <Route path="/diary/:id" element={<Diary></Diary>}></Route>
          <Route path="/diary" element={<Diary></Diary>}></Route>
        </Routes>
        <hr>
        </hr>
    </div></BrowserRouter>
  );
}

export default App;
